        static int MakeAnagram(string a, string b)
        {
            int length = a.Length;

            for (int i = 0; i < a.Length; i++)
            {
                char iCharacter = a[i];

                int index = b.IndexOf(iCharacter);

                if (index >= 0)
                {
                    b = b.Remove(index, 1);
                    a = a.Remove(i, 1);
                    i--;
                }
            }

            return a.Length + b.Length;

        }

        static int AlternatingCharacters(string s)
        {
            int deleteCount = 0;

            for (int i = 1; i < s.Length; i++)
            {
                char currentCharacter = s[i];
                char previousCharacter = s[i - 1];

                if (currentCharacter == previousCharacter)
                {
                    deleteCount++;
                }
            }

            return deleteCount;
        }

        static string IsValid(string s)
        {
            var output = s.GroupBy(c => c).Select(s => s.Count()).OrderBy(i => i);

            int noOfFrequencies = output.Distinct().Count();

            if (noOfFrequencies == 1)
            {
                return "YES";
            }

            if (noOfFrequencies == 2)
            {
                int min = output.Min();
                int minCount = output.Count(c => c == min);

                int max = output.Max();
                int maxCount = output.Count(c => c == max);

                if (minCount == 1 && min == 1)
                {
                    return "YES";
                }

                if (maxCount == 1 && max - min == 1)
                {
                    return "YES";
                }
            }

            return "NO";
        }

        private static long SubStringCount(int n, string s)
        {
            var specialPalindromes = new Dictionary<string, int>();

            int count = n;
            int currentCount;
            int breakCount = 0;

            for (int i = 2; i < n; i++)
            {
                currentCount = 0;

                int rear = n - i;

                int v = n / 2;

                for (int j = 0; j <= v; j++)
                {
                    string frontSubString = s.Substring(j, i);
                    string rearSubString = s.Substring(rear, i);

                    if (!specialPalindromes.ContainsKey(frontSubString))
                    {
                        if (IsSpecialPalindrome(frontSubString))
                        {
                            specialPalindromes.Add(frontSubString, frontSubString.Length);
                            count++;
                            currentCount++;
                        }
                    }
                    else
                    {
                        count++;
                        currentCount++;

                    }

                    if (!specialPalindromes.ContainsKey(rearSubString))
                    {
                        if (IsSpecialPalindrome(rearSubString))
                        {
                            specialPalindromes.Add(rearSubString, rearSubString.Length);
                            count++;
                            currentCount++;
                        }
                    }
                    else
                    {
                        count++;
                        currentCount++;
                    }

                    rear -= 1;

                }

                if (currentCount == 0)
                {
                    breakCount++;
                }
                else
                {
                    breakCount--;
                }

                if (breakCount >= 2)
                    break;

            }

            return count;
        }

        private static bool IsSpecialPalindrome(string subString)
        {
            int length = subString.Length;

            if (length == 1)
            {
                return true;
            }

            int count = subString.Count(c => c == subString[0]);

            if (count == length)
            {
                return true;
            }

            if (length % 2 != 0 && count == length - 1)
            {
                int middle = length / 2;

                if (subString[0] != subString[middle])
                {
                    return true;
                }
            }

            return false;
        }
